text:
Warren A. "Jimmy" Croll, Jr. (March 9, 1920 – June 6, 2008) was an American Hall of Fame Thoroughbred race horse trainer. Croll was born in 1920 in Bryn Mawr, Pennsylvania. After finishing high school, he attended the University of Pennsylvania with the intention of becoming a veterinarian but left to pursue his passion for racing Thoroughbreds. In 1940 he obtained his trainers' license but his racing career was interrupted by service with the United States Army in the Pacific Theater of Operations during World War II. Upon the 1946 opening of the new Monmouth Park Racetrack in Oceanport, New Jersey, Croll relocated there and became a permanent part of that facility's annual summer campaign. In 1998, he received Monmouth Park's "Raines Distinguished Achievement Award" given in memory of trainer Virgil W. Raines to an owner or trainer who has shown a dedication to the sport of Thoroughbred racing through exemplary conduct demonstrating professionalism and integrity. Best known as "Jimmy" Croll, he earned his first graded stakes race win with War Phar in 1951. Although Croll has had a number of good horses, there are several that stand out: 
* Parka, the 1965 American Champion Male Turf Horse; 
* Forward Gal, the 1970 American Champion Two-Year-Old Filly; 
* Bet Twice, multiple graded stakes winner including the Belmont Stakes; 
* Housebuster, 1990 and 1991 American Champion Sprint Horse; 
* Holy Bull, 1994 American Horse of the Year and a United States Racing Hall of Fame ranked No. 64 in the Blood-Horse magazine List of the Top 100 U.S. Racehorses of the 20th Century. Jimmy Croll conditioned horses for Rachel Carpenter for 37 years. At the time of her death in August 1993, she owned Croll's most famous horse, the then unraced Holy Bull. Just a few hours before the two-year-old colt made his racing debut, Croll was notified by telephone that in her will, Rachel Carpenter had bequeathed him the seven horses under his care which included Holy Bull. In retirement, Croll and his wife made their home in Monmouth Beach, New Jersey. Croll died on June 6, 2008 after a long illness at Monmouth Medical Center in Long Branch, New Jersey.
